import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";

function CompanyList() {
  const [companies, setCompanies] = useState([]);

  useEffect(() => {
    // fetch company data from API or database
    const data = [
      {
        id: 1,
        logo: "https://www.example.com/logo1.png",
        name: "Example Company 1",
        address: "123 Main St, Anytown USA",
        email: "info@example.com",
        contacts: "John Doe",
        fax: "555-555-5555",
        category: "Technology"
      },
      {
        id: 2,
        logo: "https://www.example.com/logo2.png",
        name: "Example Company 2",
        address: "456 Market St, Anytown USA",
        email: "info@example.com",
        contacts: "Jane Smith",
        fax: "555-555-5555",
        category: "Finance"
      },
      {
        id: 3,
        logo: "https://www.example.com/logo3.png",
        name: "Example Company 3",
        address: "789 Oak St, Anytown USA",
        email: "info@example.com",
        contacts: "Bob Johnson",
        fax: "555-555-5555",
        category: "Healthcare"
      }
    ];
    setCompanies(data);
  }, []);

  return (
    <div className="container">
      <h1>Company List</h1>
      <div className="row">
        {companies.map((company) => (
          <div key={company.id} className="col-md-4">
            <div className="card mb-4 box-shadow">
              <img
                className="card-img-top"
                src={company.logo}
                alt={company.name}
              />
              <div className="card-body">
                <h5 className="card-title">{company.name}</h5>
                <p className="card-text">{company.address}</p>
                <p className="card-text">{company.email}</p>
                <p className="card-text">{company.contacts}</p>
                <p className="card-text">{company.fax}</p>
                <p className="card-text text-muted">{company.category}</p>
                <div className="d-flex justify-content-between align-items-center">
                  <div className="btn-group">
                    <Link
                      to={`/companies/${company.id}`}
                      className="btn btn-sm btn-outline-secondary"
                    >
                      View
                    </Link>
                  </div>
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default CompanyList;
